import styled from "styled-components";

const ChannelInfoStyled = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  width: 32em;
  margin-top: 5em;
  border-op: 1px solid #dcdde1;
`;

export default ChannelInfoStyled;
